import Axios from 'axios'
import React, { useEffect, useState } from 'react'

function CricketDataFetch() {
    const[posts,setposts]=useState([])
    
    useEffect(()=>{
        Axios.get(`https://cricapi.com/api/matches/rXH9Y3RJu3YVsF51R6FSTwLR24h2`,{params:{unique_id:"1216526"}})
        .then(response =>{
            console.log(response.data.matches)
        })
        .catch(error=>{
            console.log(error)
        })
    })

    return (
        <div>
            CricketDataFetch
        </div>
    )
}

export default CricketDataFetch
